Oddly, I've been claiming that number all year already since it was inevitably showing up this year anyway.

But now that the officialness of that number is around the corner and I sit with that reality, it feels SO WEIRD. 

On one hand, its like "how in the fuck did I get to this number already??" But on the other, I don't feel old at all. 

My playful spirit feels the same at any age, I guess. 

The meat skeleton is doing pretty good considering all I've put her through as well.

What more can I ask for? 

I'm grateful.

I feel like I've lived so many lifetimes in this one alone and what a wild journey its been! 

Exactly how I envisioned doing life.

I'm gonna keep at my goal...the one of dying young as late as possible and I'm also gonna keep at the goal of truly living while I'm here.

This place is pretty fun when you no longer get caught up in the bullshit. 

This planet has always been a bit crazy. Its how you navigate it that counts!

